import { isAxiosError } from 'axios';

import type { LedgerPDFSearchConditionInput } from '@shared/schemas/ledger/inquiry/ledgerPDFSearchCondition';
import {
  ledgerPDFSearchResultSchema,
  type LedgerPDFSearchResult,
  type LedgerPDFSearchResultInput,
} from '@shared/schemas/ledger/inquiry/ledgerPDFSearchResult';
import { apiClient } from '@shared/service/apiClient';
import { AppError } from '@shared/utils/appError';
import { toSearchParams } from '@shared/utils/utilityFunction';

export const fetchLedgerPDFForBack = async (
  condition: LedgerPDFSearchConditionInput,
): Promise<LedgerPDFSearchResult> => {
  try {
    const params = new URLSearchParams(toSearchParams(condition));
    const response = await apiClient.fetchForBrowser<LedgerPDFSearchResultInput>(
      `ledgersManagement/pdfDownload?${params}`,
    );
    const data = ledgerPDFSearchResultSchema.parse(response);
    return data;
  } catch (error) {
    //FIXME: 環境変数どうするか検討する
    // if (import.meta.env.DEV) {
    //   console.error(error);
    // }
    if (process.env.ENV === 'local') {
      console.error(error);
    }

    if (isAxiosError(error)) {
      //NOTE: axiosのエラーによってエラーページを分ける場合はここを書き換える
      throw new AppError('unknown');
    }

    throw new AppError('unknown');
  }
};

